export default function Login() {
    return (
        <div className="formbox">
            <form method="post">
                <label htmlFor="username" >Username :</label>
                <input type={"text"} name="username" />
                <label htmlFor="pass" >Password :</label>
                <input type={"text"} name="pass" />
            </form>
        </div>
    )
}
